import 'bootstrap/dist/css/bootstrap.min.css';
import * as ReactBootStrap from 'react-bootstrap';
import React, { useState } from 'react';
import HomeComp from './Home';

function NavBarComp() {

  const [page, setPage] = useState("./Components/Home");

    return (
      <div className="App">


        <ReactBootStrap.Navbar bg="light" expand="lg">
          <ReactBootStrap.Container>
            <ReactBootStrap.Navbar.Brand>Yohan Arejouane</ReactBootStrap.Navbar.Brand>
            <ReactBootStrap.Navbar.Toggle aria-controls="basic-navbar-nav" />
            <ReactBootStrap.Navbar.Collapse id="basic-navbar-nav">
              <ReactBootStrap.Nav className="me-auto">
                <ReactBootStrap.Nav.Button onClick={() => setPage("./Components/Home")}>Home</ReactBootStrap.Nav.Button>
                <ReactBootStrap.Nav.Link href="#link">Portfolio</ReactBootStrap.Nav.Link>
                <ReactBootStrap.NavDropdown title="More about me" id="basic-nav-dropdown">
                  <ReactBootStrap.NavDropdown.Item href="#action/3.1">LinkedIn</ReactBootStrap.NavDropdown.Item>
                  <ReactBootStrap.NavDropdown.Item href="#action/3.2">Github</ReactBootStrap.NavDropdown.Item>
                  <ReactBootStrap.NavDropdown.Item href="#action/3.3">Instagram</ReactBootStrap.NavDropdown.Item>
                  <ReactBootStrap.NavDropdown.Divider />
                  <ReactBootStrap.NavDropdown.Item href="#action/3.4">CV</ReactBootStrap.NavDropdown.Item>
                </ReactBootStrap.NavDropdown>
              </ReactBootStrap.Nav>
            </ReactBootStrap.Navbar.Collapse>
          </ReactBootStrap.Container>
        </ReactBootStrap.Navbar>


        {page === "./Components/Home" && <HomeComp/>}



      </div>
    );
  }

  export default NavBarComp;
